import React from 'react';
import { Card, Typography, List, ListItem, ListItemIcon, ListItemText, Divider, Box, Chip } from '@mui/material';
import {
  MedicalServices,
  Warning,
  CheckCircle,
  Info,
  LocalHospital,
  MonitorHeart,
  Psychology,
  FitnessCenter,
  Restaurant,
  Spa
} from '@mui/icons-material';

const MedicalHistoryAnalysis = ({ analysis }) => {
  if (!analysis) return null;

  // Helper function to extract sections from the analysis text
  const extractSection = (text, sectionTitle) => {
    if (!text) return '';
    const sections = text.split(/\d+\.\s+/);
    const section = sections.find(s => s.includes(sectionTitle));
    if (section) {
      const content = section.split(sectionTitle + ':')[1]?.trim();
      return content || section.trim();
    }
    return '';
  };

  // Extract sections from the analysis text
  const analysisText = analysis.analysis || '';
  const sections = [
    {
      title: 'Differential Diagnosis',
      icon: <Warning />,
      content: extractSection(analysisText, 'Differential Diagnosis')
    },
    {
      title: 'Risk Assessment',
      icon: <LocalHospital />,
      content: extractSection(analysisText, 'Risk Assessment')
    },
    {
      title: 'Recommended Tests',
      icon: <MonitorHeart />,
      content: extractSection(analysisText, 'Recommended Diagnostic Tests')
    },
    {
      title: 'Treatment Plan',
      icon: <CheckCircle />,
      content: extractSection(analysisText, 'Treatment Considerations')
    }
  ];

  const lifestyleSections = [
    {
      title: 'Diet and Nutrition',
      icon: <Restaurant />,
      content: extractSection(analysisText, 'Diet and Nutrition')
    },
    {
      title: 'Exercise Guidelines',
      icon: <FitnessCenter />,
      content: extractSection(analysisText, 'Exercise Guidelines')
    },
    {
      title: 'Stress Management',
      icon: <Spa />,
      content: extractSection(analysisText, 'Stress Management')
    }
  ];

  return (
    <Box sx={{ mt: 4 }}>
      <Typography variant="h4" gutterBottom sx={{ color: '#2c3e50', fontWeight: 'bold' }}>
        Medical Analysis Report
      </Typography>

      <Card sx={{ p: 3, mb: 3, backgroundColor: '#f8f9fa', boxShadow: 3 }}>
        <Typography variant="h6" gutterBottom sx={{ color: '#34495e', display: 'flex', alignItems: 'center', gap: 1 }}>
          <MedicalServices sx={{ color: '#3498db' }} />
          Patient Overview
        </Typography>
        <Typography variant="body1" sx={{ color: '#2c3e50', mt: 2 }}>
          <strong>Age:</strong> {analysis.patient_info?.age || 'Not provided'}<br />
          <strong>Gender:</strong> {analysis.patient_info?.gender || 'Not provided'}<br />
          <strong>Symptoms:</strong> {analysis.symptoms?.join(', ') || 'None provided'}<br />
          <strong>Medical History:</strong> {analysis.patient_info?.medical_history || 'Not provided'}
        </Typography>
      </Card>

      <Box sx={{ display: 'grid', gridTemplateColumns: { xs: '1fr', md: '1fr 1fr' }, gap: 3 }}>
        <Card sx={{ p: 3, backgroundColor: '#f8f9fa', boxShadow: 3 }}>
          <Typography variant="h6" gutterBottom sx={{ color: '#34495e', mb: 2 }}>
            Clinical Assessment
          </Typography>
          <List>
            {sections.map((section, index) => (
              <React.Fragment key={index}>
                <ListItem alignItems="flex-start">
                  <ListItemIcon sx={{ color: '#3498db', minWidth: 40 }}>
                    {section.icon}
                  </ListItemIcon>
                  <ListItemText
                    primary={
                      <Typography variant="subtitle1" sx={{ fontWeight: 'bold', color: '#2c3e50' }}>
                        {section.title}
                      </Typography>
                    }
                    secondary={
                      <Typography 
                        variant="body2" 
                        sx={{ 
                          color: '#34495e', 
                          mt: 1,
                          whiteSpace: 'pre-line' // Preserve line breaks
                        }}
                      >
                        {section.content || `${section.title} analysis pending`}
                      </Typography>
                    }
                  />
                </ListItem>
                {index < sections.length - 1 && <Divider />}
              </React.Fragment>
            ))}
          </List>
        </Card>

        <Card sx={{ p: 3, backgroundColor: '#f8f9fa', boxShadow: 3 }}>
          <Typography variant="h6" gutterBottom sx={{ color: '#34495e', mb: 2 }}>
            Lifestyle Recommendations
          </Typography>
          <List>
            {lifestyleSections.map((section, index) => (
              <React.Fragment key={index}>
                <ListItem alignItems="flex-start">
                  <ListItemIcon sx={{ color: '#2ecc71', minWidth: 40 }}>
                    {section.icon}
                  </ListItemIcon>
                  <ListItemText
                    primary={
                      <Typography variant="subtitle1" sx={{ fontWeight: 'bold', color: '#2c3e50' }}>
                        {section.title}
                      </Typography>
                    }
                    secondary={
                      <Typography 
                        variant="body2" 
                        sx={{ 
                          color: '#34495e', 
                          mt: 1,
                          whiteSpace: 'pre-line' // Preserve line breaks
                        }}
                      >
                        {section.content || `${section.title} recommendations pending`}
                      </Typography>
                    }
                  />
                </ListItem>
                {index < lifestyleSections.length - 1 && <Divider />}
              </React.Fragment>
            ))}
          </List>
        </Card>
      </Box>

      <Card sx={{ p: 3, mt: 3, backgroundColor: '#f8f9fa', boxShadow: 3 }}>
        <Typography variant="h6" gutterBottom sx={{ color: '#34495e', display: 'flex', alignItems: 'center', gap: 1 }}>
          <Psychology sx={{ color: '#e74c3c' }} />
          Follow-up Recommendations
        </Typography>
        <Typography variant="body1" sx={{ color: '#2c3e50', whiteSpace: 'pre-line' }}>
          {extractSection(analysisText, 'Follow-up Recommendations') || 'Follow-up recommendations pending'}
        </Typography>
      </Card>

      <Card sx={{ p: 3, mt: 3, backgroundColor: '#f8f9fa', boxShadow: 3 }}>
        <Typography variant="h6" gutterBottom sx={{ color: '#34495e', display: 'flex', alignItems: 'center', gap: 1 }}>
          <Warning sx={{ color: '#e74c3c' }} />
          Important Notes
        </Typography>
        <List>
          <ListItem>
            <ListItemText
              primary={
                <Typography variant="body1" sx={{ color: '#2c3e50' }}>
                  • This is an AI-generated preliminary analysis and should not replace professional medical evaluation
                </Typography>
              }
            />
          </ListItem>
          <ListItem>
            <ListItemText
              primary={
                <Typography variant="body1" sx={{ color: '#2c3e50' }}>
                  • Seek immediate medical attention if symptoms worsen or new symptoms develop
                </Typography>
              }
            />
          </ListItem>
          <ListItem>
            <ListItemText
              primary={
                <Typography variant="body1" sx={{ color: '#2c3e50' }}>
                  • Regular follow-up with healthcare providers is essential
                </Typography>
              }
            />
          </ListItem>
        </List>
      </Card>
    </Box>
  );
};

export default MedicalHistoryAnalysis;
